import React, { Fragment, Component } from 'react';
import { Container, Row, Col } from 'reactstrap';
import './Main.css';
class Main extends Component {
  render() {
    return (
      <Fragment>
        <Container>
          <Row className='borderSwitchPicture'>
            <Col style={(Border = 'black 2px')}>תמונות מתחלפות</Col>
          </Row>
          <Row>
            <Col style={(Border = 'black 2px')} sm='6'>
              Rישום
            </Col>
            <Col style={(Border = 'black 2px')} sm='6'>
              מלל
            </Col>
          </Row>
        </Container>
      </Fragment>
    );
  }
}
export default Main;
